import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
    <img src={logo} className="logo" width="40px"/>
    <h1>Fun facts about React</h1>
    <ul>
      <li>Was first released in 2013</li>
      <li>Was orginally created by Jordan Walke</li>
    </ul>
    </div>
  );
}

export default App;
